import React from "react";
import AddIcon from '@material-ui/icons/Add';
import DeleteIcon from '@material-ui/icons/Remove';

function AddButton(props){
    return <button onClick={props.handleAdded} className="add-button">
    {(props.delete) ? <DeleteIcon className="vanishing-button" style={{color:"white"}} /> 
                        :<AddIcon className="vanishing-button" style={{color:"white"}}  />}</button>
}

export default AddButton;
